
-- Crear base de datos
CREATE DATABASE IF NOT EXISTS Pinacoteca;
USE Pinacoteca;

-- Crear tabla cuadros
CREATE TABLE IF NOT EXISTS cuadros (
    id INT(3) AUTO_INCREMENT PRIMARY KEY,
    nombre VARCHAR(100),
    autor VARCHAR(100),
    anyo INT(4),
    periodo VARCHAR(100),
    ubicacion VARCHAR(100),
    imagen MEDIUMTEXT
);

